INSERT INTO `club_details` (`id`, `name`, `description`, `incharge_id`, `deo_entry_by`, `entry_by`, `timestamp`) VALUES
(1, 'Go Green', 'Young people see a problem and are instantly motivated to act. A school environment club gives students the platform they need to take action on the environmental issues they feel passionate about. Channeling student energy and enthusiasm into an environment club will let students take a leadership role in identifying and achieving your school’s environmental goals.', 1, -1, 1, '2015-09-01 09:57:34'),
(2, 'Olympiad', 'The NSO is open to the students of classes 5 to 12. Prospectus containing the Registration forms are sent to all schools registered with SOF.  The National Science Olympiad is conducted in two levels:     Level 1: The first level of the test is organized in the respective schools of the participants during school hours.  (i) The level 1 competition is a written objective-type test of 60 minutes duration comprising  50 objective-type (Multiple Choice) questions for class 5 to class 12.', 70, 80, 70, '2015-09-02 08:02:20'),
(3, 'Quiz competition', 'The School level quiz competition last date of fill the form is 12 september 2015.', 60, -1, 1, '2015-09-02 08:02:20'),
(4, 'Drawing competition', 'The drawing competition has been organized in eight member states of the  india.  6 to 12th class student can be aply it.', 61, -1, 1, '2015-09-02 08:02:20'),
(5, 'Science exhibition', 'Last date of form is 1 october 2015.', 19, -1, 1, '2015-09-02 08:02:20'),
(6, 'Dance competition', 'Interested student can enroll their names.', 61, -1, 1, '2016-06-02 12:38:53'),
(7, 'Cricket Competition', '10 to 12th student can apply the form.', 35, -1, 1, '2015-09-02 08:02:20'),
(8, 'Hockey competition', 'our school is organising hockey competition on 12 september 2016.', 30, -1, 1, '2016-06-02 12:39:10'),
(9, 'PPT Competition', 'our school is organising ppt competition on 15 september 2015.', 21, -1, 1, '2015-09-02 08:02:20'),
(10, 'School tour', 'The school is organising one week trip to shimla, from the 17-23 october. Interested students give in their names.', 4, -1, 1, '2016-06-02 12:39:26');
